export const COLUMNS = [
    {
        Header: 'Name',
        accessor: 'name',
        disableSortBy: true,
        disableFilters: true
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Initial price',
        accessor: 'initial_price'
    },
    {
        Header: 'Actual bind',
        accessor: 'last_bind'
    },
    {
        Header: 'User',
        accessor: 'last_bind_user',
        disableSortBy: true
    }
]
